import React from "react";
import "./header.css";
export default function Header() {
  return (
    <div className="header">
      <div className="group-nav">
        <div className="left">asddd</div>
        <nav className="nav">
          <ul className="list_menu">
            <li className="item-nav">Logo</li>
            <li className="item-nav">Mess</li>
            <li className="item-nav">List</li>
            <li className="item-nav">Library</li>
          </ul>
        </nav>
        <div className="right">add</div>
      </div>
    </div>
  );
}
